description:
CONTAINS ALL 6 EPISODES OF THE 2ND/FINAL SERIES :)

SAXONDALE is a BABY COW PRODUCTION about an aging roadie/rock star wannabe with serious anger management issues called Tommy Saxondale (Steve Coogan) who runs his own pest control business. Although Tommy often lives in the past, he's also ashamed to admit that in recent years his priorities have somewhat changed.He resides with his curvaceous girlfriend called Magz (Ruth Jones) and a young chap called Raymond (Rasmus Hardiker) who Tommy has very kindly taken under his wing. James Bachman returns as Alistair the anger management guru, Morwenna Banks also returns as Vicky the... actually I'm not quite sure what her job is... and Darren Boyd joins the main cast as Tommy's irritatingly polite neighbour. Special guests include Matt Berry, Greg Davies, Kevin Eldon, Alex Lowe, Christopher Ryan and Tom Meeten to name a few.

